import ViajeContext from "context/ViajesContext";

const ViajesCrud = () => {
  const { datadel } = useContext(ViajeContext);
  console.log()
  return (
    <>
      <TableViajes />
      <Modal>
        <FormViajes />
      </Modal>
      <AlertDelete>
         { datadel &&  `Usted esta seguro que desea eliminar el viaje ${datadel.orige - datadel.destino } de la lista de viajes`
           }
      </AlertDelete>
    </>
  );
};

export default ViajesCrud;
